css:
atom-text-editor,
:host {
  background-color: #1c2733;
  color: #f8f8f2;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #1c2733;
  color: #f8f8f2;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: rgba(149, 163, 166, 0.24);
  color: #f8f8f2;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #f8f8f2;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  color: #636e74;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #234154;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #234154;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: #546a68;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: #f8f8f2;
}
atom-text-editor.is-focused .cursor,
:host(.is-focused) .cursor {
  border-color: #f8f8f0;
}
atom-text-editor.is-focused .selection .region,
:host(.is-focused) .selection .region {
  background-color: rgba(149, 163, 166, 0.24);
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host(.is-focused) .line-number.cursor-line-no-selection,
:host(.is-focused) .line.cursor-line {
  background-color: #1d2836;
}
.comment {
  font-weight: lighter;
  font-style: italic;
  color: #a2a2a2;
}
.string {
  color: #65c1ee;
}
.constant.numeric {
  color: #aa78d6;
}
.constant.language {
  color: #e57edd;
}
.constant.character,
.constant.other {
  color: #28e6a5;
}
.variable {
  color: #899ffa;
}
.keyword {
  color: #e6f99a;
}
.storage {
  color: #D95757;
}
.storage.type {
  font-weight: lighter;
  font-style: italic;
  color: #baffa6;
}
.entity.name.class {
  color: #fff;
}
.entity.other.inherited-class {
  font-style: italic;
  color: #F2AAEC;
}
.entity.name.function {
  font-weight: bold;
  color: #e2ff2d;
}
.variable.other.constant {
  color: #FCC672;
}
.variable.parameter {
  color: #72fcd7;
}
.entity.name.tag {
  color: #92E89D;
}
.entity.other.attribute-name {
  color: #93E690;
}
.punctuation.section.embedded.begin.asp,
.punctuation.section.embedded.end.asp {
  color: #CFAFCF;
}
.support.function {
  color: #FFF;
}
.support.constant {
  color: #FFB266;
}
.support.type,
.support.class {
  color: #F7FCA2;
}
.punctuation.definition.tag.html,
.punctuation.definition.tag.begin.html,
.punctuation.definition.tag.end.html {
  color: #F7FCA2;
}
.support.other.namespace,
.entity.name.type.namespace {
  color: #FFD2A6;
}
.support.other.namespace.use-as.php {
  color: #FFB266;
}
.variable.language.namespace.php {
  color: #D17B7B;
}
.punctuation.separator.inheritance.php {
  color: #E57EDD;
}
.entity.other.attribute-name.pseudo-class.css {
  font-style: italic;
  color: #93E690;
}
.support.function.misc.css,
.support.constant.property-value.css,
.support.constant.font-name.css {
  color: #FFD2A6;
}
.support.type.proerty {
  color: #242424;
}
.constant.numeric.css {
  color: #8AD6F2;
}
.variable.parameter.misc.css {
  color: #78BDD6;
}
.entity.other.tagbraces.twig {
  color: #E57EDD;
}
.keyword.control.twig {
  color: #FFB266;
}
.variable.other.twig {
  color: #FFCCFB;
}
.support.function.filter.twig {
  color: #D95757;
}
.support.function.filter.variable.twig {
  color: #E57EDD;
}
.entity.name.function.twig {
  color: #D95757;
}
.entity.other.argument.twig {
  color: #FFB2B2;
}
.invalid {
  color: #F8F8F0;
  background-color: #D95757;
}
.invalid.deprecated {
  color: #F8F8F0;
  background-color: #E57EDD;
}
.constant.character.escaped,
.constant.character.escape,
.string .source,
.string .source.ruby {
  color: #F2AAEC;
}
